- proto: WeaponPistolMk58
  entities:
  - uid: 6098
    components:
    - type: MetaData
      desc: Colt M1911 широко известен как один из самых элегантных и стреляющих пистолетов всех времен, и остается популярным после более чем столетнего срока службы. Почти все современные полуавтоматические пистолеты основаны на этой конструкции, что делает его самым известным из многих образцов огнестрельного оружия Джона Браунинга. 1911 год стал официальным оружием армии США, заменив револьверы 38-го калибра, такие как Model 10, и удерживал эту позицию до тех пор, пока в 1985 году его не заменила Beretta M9.1911-й - это оружие одинарного действия, поэтому перед выстрелом вы должны взветь курок, либо отведя его непосредственно назад, либо передернув затвор. Если курок возвращен на место и при нажатии кнопки вы видите латунь в патроннике, то он должен выстрелить хотя бы один раз, даже под разрушающим воздействием Угрозы. Начинающие стрелки часто сталкиваются со сбоями в работе "дымохода" при последующих выстрелах, когда стреляная гильза застревает в отверстии для выброса. Вы можете устранить эту неисправность, наклонив оружие и вручную передернув затвор, чтобы извлечь стреляную гильзу и вставить новую в патронник.
